/**
 * @author Ahmed Rafsan Raqib
 * This module contains the Driver data.
 */

const mongoose = require("mongoose");

const driversSchema = {
  name: String,
  driverID: String,
  email: String,
  vehicleId: String,
  latitude: Number,
  longitude: Number,
};

const Driver = mongoose.model("Driver", driversSchema);
module.exports = Driver;
